import React, {Component} from 'react';
import Customer from './components/Customer';
import './App.css';

const customers=[
  {
    'id' : 1,
    'name':'양성원',
    'birthday' : '991106',
    'gender' : '남성',
    'job' : '대학생'
  },
  {
    'id' : 2,
    'name' : '강윤주',
    'birthday' : '000110',
    'gender' : '여성',
    'job' : '대학생'
  },
]

class App extends Component{
  render(){
    return(
      <div>
        {customers.map(c=>{
          return <Customer key={c.id} id={c.id} image={c.image} birthday={c.birthday} gender={c.gender} job={c.job} />
        })}
      </div>    
    );
  };
}

export default App;
